import React from 'react';
import TrainerCover from '../Profiles/TrainerCover';
import getTrainers from '../../trainers-get';

import Loading from '../Loading/Loading';

export default class Trainers extends React.Component {
    constructor() {
        super();
        this.state = { trainerData: [] };
    }

    render() {
        let trainers = this.state.trainerData;

        if(!trainers) {
            return <Loading />;
        }
        return (
            <div className='container'>
                {
                    trainers.map(trainer => (
                        <TrainerCover 
                            key = {trainer.id}
                            id = {trainer.id}
                            firstname = {trainer.firstname}
                            lastname = {trainer.lastname}
                            src = {trainer.src}
                            alt = {trainer.lastname}
                        />
                    ))
                }
            </div>
        );
    }

